INSERT INTO inversion_instrumentos VALUES
("1","BitCoin","U$D","","bitcoin","BTC","criptomoneda","Bitcoin, la primera y más grande criptografía del mundo por capitalización de mercado, se considera la primera implementación a gran escala de la tecnología blockchain. La cadena de bloques de Bitcoin se diseñó para permitir transacciones rápidas y seguras, al tiempo que mantiene el anonimato de sus usuarios, mediante el uso de un libro mayor público para autenticar las transacciones. Bitcoin ha liderado la industria de las criptomonedas desde sus inicios en 2009, evolucionando desde la única criptografía del mundo hasta la más grande de cientos de otras criptomonedas. A lo largo de los años, la cadena de bloques de Bitcoin pasó por varios cambios. Un ejemplo destacado fue la bifurcación dura de Bitcoin Cash, que tuvo lugar en agosto de 2017 y dio como resultado la creación de Bitcoin Cash, una criptografía multimillonaria propia.","https://assets.coingecko.com/coins/images/1/large/bitcoin.png","20992","-2.96701","2022-06-16 13:20:02"),
("2","Ethereum","U$D","","ethereum","ETH","criptomoneda","","https://assets.coingecko.com/coins/images/279/large/ethereum.png","1107.46","-5.59392","2022-06-16 13:20:02"),
("3","USDT","U$D","","tether","USDT","criptomoneda","","https://assets.coingecko.com/coins/images/325/large/Tether-logo.png","0.999652","-0.16716","2022-06-16 13:20:02"),
("4","Binance Coin","U$D","","binancecoin","BNB","criptomoneda","","https://assets.coingecko.com/coins/images/825/large/binance-coin-logo.png","215.93","-1.70351","2022-06-16 13:20:04"),
("5","XRP","U$D","","ripple","XRP","criptomoneda","","https://assets.coingecko.com/coins/images/44/large/xrp-symbol-white-128.png","0.318157","-0.97227","2022-06-16 13:20:04"),
("6","Etf Ark Innovation","$","","ARKK","ARKK","cedear","El fondo cotizado en bolsa ARKK busca el crecimiento de su patrimonio en el largo plazo invirtiendo al menos 65% de su portafolio en renta variable de Estados Unidos. Las empresas que selecciona son de \"innovación disruptiva\", o que cambia el comportamiento del usuario gracias a nuevas tecnologías. Algunas de las áreas en las que invierte son las de revolución genómica (aplicaciones de ADN), innovación energética, Internet de próxima generación y desarrollos para empresas del tipo Fintech. Este fondo es administrado por ARK Investment Management LLC, empresa fundada en 2013.\n\n\n\nARK Innovation es un ETF de capital activo. Cotiza en NYSE desde 2014 y para agosto de 2020 tiene activos totales por más de 6.900 millones de dólares. Tesla, Invitae y Cuadrado forman casi el 25% de las tenencias. Su portafolio de inversión a la fecha de junio de 2020 se compone de empresas de comercio electrónico con el 10.6%, terapia de genes con el 10.2% y diagnóstico molecular con el 10%. \n\n\n\nEn 2019, ARKK fue reconocido como el ETF activo del año por los ETF Awards. El gráfico de ARKK tuvo una increíble suba del 80% en lo que va del año 2020 hasta el mes de agosto. ","https://etoro-cdn.etorostatic.com/market-avatars/3166/150x150.png","899","-4.72","2022-06-16 13:20:02"),
("7","Etf Spdr Dow Jones Industrial","$","","DIA","DIA","cedear","El objetivo de este ETF es reflejar las fluctuaciones del índice Dow Jones Industrial Average. El Dow Jones es uno de los índices más antiguos de EE.UU. y se creó para reflejar el rendimiento general del sector industrial. El precio de este ETF podría cambiar de acuerdo con el Dow Jones, como resultado de cambios en el sector industrial provocados por la legislación, una importante fluctuación en la acción de una sola empresa y otros factores.","https://etoro-cdn.etorostatic.com/market-avatars/dia/150x150.png","3598.5","-2.04","2022-06-16 13:20:02"),
("8","Etf Ishares Msci Emerging Market","$","","EEM","EEM","cedear","Al incluir a 23 mercados emergentes que representan a un 10% de la economía mundial, el ETF EEM ofrece a los inversores exposición a países que a veces cuentan con una menor presencia en los mercados globales. Este ETF rastrea el rendimiento del mercado de capitales de estos países y supone una opción de inversión para quienes desean obtener beneficios en estos mercados emergentes. El fondo se ve afectado por diversos factores relacionados con las economías de cada uno de los países.","https://etoro-cdn.etorostatic.com/market-avatars/eem/150x150.png","1903.5","-2.41","2022-06-16 13:20:03"),
("9","Etf Ishares Msci Brazil","$","","EWZ","EWZ","cedear","Administrado por Blackrock e introducido al mercado en 2007, el ETF iShares MSCI Brazil busca replicar los resultados de inversión de un índice compuesto por valores de renta variable de Brasil. Cotiza en la NYSE con el símbolo bursátil EWZ.","https://etoro-cdn.etorostatic.com/market-avatars/ewz/150x150.png","3377","-4.43","2022-06-16 13:20:04"),
("10","Etf Ishares Trust Russell 2000","$","","IWM","IWM","cedear","Ishares Russell 2000 ETF (USD) invierte en firmas de pequeña capitalización en Estados Unidos. Sus acciones se cotiza en la NYSE con el símbolo IWM, fue lanzado en el año 2000 y tiene su sede en Princeton, Nueva Jersey (EE. UU.). Es administrado por Jennifer Hsui, Alan Mason, Greg Savage y Amy Whitelaw","https://etoro-cdn.etorostatic.com/market-avatars/iwm/150x150.png","3958","-3.27","2022-06-16 13:20:04"),
("11","Etf Invesco Qqq Trust","$","","QQQ","QQQ","cedear","Este ETF consta de las mismas empresas incluidas en el índice Nasdaq 100 y ofrece a los inversores exposición al mercado estadounidense. El índice Nasdaq 100 se compone de las 100 mayores empresas de Estados Unidos, excluyendo el sector financiero. El ETF «Powershares QQQ» podría verse afectado por fluctuaciones importantes en el precio de una empresa dentro del índice, y por tendencias económicas generales de Estados Unidos","https://etoro-cdn.etorostatic.com/market-avatars/qqq/150x150.png","3272.5","-2.95","2022-06-16 13:20:05"),
("12","Etf Spdr S&P 500","$","","SPY","SPY","cedear","El índice Standard & Poor\'s 500, también conocido como S&P 500, es uno de los índices bursátiles más importantes de Estados Unidos. Al S&P 500 se lo considera el índice más representativo de la situación real del mercado.​El índice se basa en la capitalización bursátil de 500 grandes empresas que poseen acciones que cotizan en las bolsas NYSE o NASDAQ, y captura aproximadamente el 80% de toda la capitalización de mercado en Estados Unidos. Los componentes del índice S&P 500 y su ponderación son determinados por S&P Dow Jones Indices. Se diferencia de otros índices de mercados financieros de Estados Unidos, tales como el Dow Jones Industrial Average o el índice Nasdaq Composite, en la diversidad de los rubros que lo conforman y en su metodología de ponderación. Es uno de los índices de valores más seguidos, y muchas personas lo consideran el más representativo del mercado de acciones de Estados Unidos, y el marcador de tendencias de la economía norteamericana.​ El National Bureau of Economic Research ha clasificado a las acciones comunes como un indicador relevante de los ciclos de negocios.​","https://etoro-cdn.etorostatic.com/market-avatars/spy/150x150.png","4439","-1.56","2022-06-16 13:20:05"),
("13","Etf Spdr Energy Sector","$","","XLE","XLE","cedear","El ETF «Energy Select Sector SPDR» ofrece exposición a importantes empresas del mercado energético de Estados Unidos. Consta de empresas de la industria de la producción de gas natural y petróleo, así como de otras dedicadas a servicios relacionados con la energía, como la perforación petrolífera. Ofrece una opción «pasiva» con un relativo bajo coste a los inversores que buscan una herramienta de inversión temática en el sector de la energía, y su precio se ve afectado por factores relacionados con la industria.","https://etoro-cdn.etorostatic.com/market-avatars/xle/150x150.png","9343","-5.4","2022-06-16 13:20:06"),
("14","Etf Spdr Financial Sector","$","","XLF","XLF","cedear","El ETF «Financial Select Sector SPDR» ofrece exposición a importantes empresas de la industria financiera de Estados Unidos. Consta de organizaciones financieras estadounidenses, como el holding Berkshire Hathaway de Warren Buffett. Este fondo ofrece una opción «pasiva» con un relativo bajo coste a los inversores que buscan una herramienta de inversión temática en el sector financiero, y su precio se ve afectado por factores relacionados con la industria","https://etoro-cdn.etorostatic.com/market-avatars/xlf/150x150.png","3718","-1.82","2022-06-16 13:20:06"),
("15","Apple","$","","AAPL","AAPL","cedear","Apple Inc. es una empresa tecnológica que inventó el Macintosh en 1984 y muchas otras innovaciones, incluyendo el iPhone, iPad, Mac, Apple Watch y Apple TV. Apple opera cuatro plataformas de software: iOS, macOS, watchOS y tvOS, y servicios en línea como App Store, Apple Music, Apple Pay e iCloud. Los resultados de la empresa en el tercer trimestre del año fiscal 2018 incluyeron unos ingresos de 53.300 millones de dólares, un incremento del 17 % con respecto al mismo trimestre del año pasado.","https://etoro-cdn.etorostatic.com/market-avatars/aapl/150x150.png","3144","-2.53","2022-06-16 13:20:07"),
("16","Abbvie Inc.","$","","ABBV","ABBV","cedear","AbbVie Inc. es una empresa farmacéutica que descubre, desarrolla y comercializa terapias avanzadas, centrándose en la inmunología, oncología, neurociencia y otras áreas. Más de 26 millones de pacientes en más de 200 países reciben tratamiento con medicamentos de AbbVie cada año y la empresa opera 22 plantas de investigación primaria y fabricación en todo el mundo. Los resultados del segundo trimestre de la empresa en el año fiscal 2018 incluyeron unos ingresos netos de 8278 millones de dólares según los PCGA. Siga a este instrumento para obtener más información y noticias sobre el valor actual de ABBV.","https://etoro-cdn.etorostatic.com/market-avatars/abbv/150x150.png","3325","1.31","2022-06-16 13:20:07"),
("17","Ambev","$","","ABEV","ABEV","cedear","La empresa Ambev ADR. se dedica a la producción de cerveza para comercializarla por medio de sus filiales en Brasil, América Central y a nivel internacional. Se fundó en 1885 y tiene su sede en São Paulo (Brasil). Las acciones de Ambev se negocian en la NYSE con el símbolo bursátil ABEV.","https://etoro-cdn.etorostatic.com/market-avatars/4249/150x150.png","1772","-3.3","2022-06-16 13:20:08"),
("18","Abbott Laboratories","$","","ABT","ABT","cedear","Abbot Laboratories desarrolla y fabrica productos sanitarios en todo el mundo, enfocándose en los segmentos de productos farmacéuticos, productos de diagnóstico, productos nutricionales y dispositivos médicos. Se fundó en 1888 y tiene su sede en Abbot park, Illinois (EE. UU.). Se cotiza en la NYSE con el símbolo bursátil ABT.","https://etoro-cdn.etorostatic.com/market-avatars/abt/150x150.png","6143.5","-3.24","2022-06-16 13:20:08"),
("19","Adobe Systems Incorporated","$","","ADBE","ADBE","cedear","Adobe Systems Inc. se fundó en 1982 y su sede se ubica en California. Esta empresa de software ofrece una línea de soluciones para clientes particulares y corporativos de todo el mundo. Entre los productos de Adobe se incluyen Adobe Acrobat, Photoshop, InDesign, Illustrator, y más. Las empresa tiene oficinas en América del Norte, Asia, Australia, Nueva Zelanda, Europa, Oriente Medio, África y América del Sur. En el año fiscal 2017, los ingresos de la empresa alcanzaron la cifra de 7302 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/adbe/150x150.png","4000","-2.69","2022-06-16 13:20:08"),
("20","Adecoagro","$","","ADGO","ADGO","cedear","","data:image/jpeg;base64,","4426","-4.41","2022-06-16 13:20:09"),
("21","Analog Devices","$","","ADI","ADI","cedear","Analog Devices es una empresa estadounidense de semiconductores, ubicada en Norwood, Massachusetts. Dos graduados del MIT, Ray Stata y Matthew Lorber, fundaron la empresa en 1965. Analog Devices desarrolla tecnología que se utiliza para convertir luz, sonido y temperatura en señales electrónicas. La empresa rebasó la marca de 1000 millones de dólares en ingresos por primera vez en 1996, y superó los 10,000 productos disponibles para su venta en 2004.\n\n\n\nAnalog Devices salió a bolsa en 1969, y cotiza en el índice Nasdaq con el símbolo ADI. Su OPV inicial era para la bolsa de Nueva York, donde ya no está disponible. La acción de ADI también cotiza en los índices Nasdaq-100 y S&P 500.\n\n\n\nAnalog Devices ha ido estableciendo una fuerte presencia mundial con los años. Además de la sede de la empresa en Estados Unidos, cuenta con sedes regionales en China, Alemania, Irlanda y Japón. También tiene oficinas en Australia, Canadá, Inglaterra, Israel, España, Taiwán, y más. Analog Devices cuenta además con una instalación de pruebas en Filipinas.","https://etoro-cdn.etorostatic.com/market-avatars/4264/150x150.png","11474","-0.14","2022-06-16 13:20:09"),
("22","Agnico Eagle Mines Limited","$","","AEM","AEM","cedear","Agnico Eagle Mines es una empresa minera de oro dedicada a la producción de metales preciosos desde su fundación en 1953. Tiene su sede principal en Toronto, Canadá, y comercializa sus productos en Canadá, México y Finlandia. Agnico Eagle Mines cotiza en la bolsa de valores de New York bajo el símbolo bursátil AEM","https://etoro-cdn.etorostatic.com/market-avatars/6582/150x150.png","3816.5","0","2022-06-16 13:20:10"),
("23","American International Group","$","","AIG","AIG","cedear","American International Group Inc, fundada en 1919, ofrece productos y servicios de seguro a clientes tanto en Norteamérica como a nivel internacional. Tiene su oficina principal en Nueva York (EE. UU.), y sus acciones se cotizan en la NYSE con el símbolo bursátil AIG","https://etoro-cdn.etorostatic.com/market-avatars/aig/150x150.png","2400.5","-5.19","2022-06-16 13:20:10"),
("24","Applied Materials","$","","AMAT","AMAT","cedear","Applied Materials Inc. es una empresa tecnológica centrada en soluciones de diseño de materiales para los sectores de los semiconductores, pantallas planas y fotovoltaico solar (FV). La empresa cuenta con 11,900 patentes y 18,400 empleados en 90 ubicaciones en 17 países en todo el mundo. Applied Materials se especializa en modificar materiales a escala atómica e industrial. Los resultados de la empresa en el segundo trimestre del año fiscal 2018 incluyeron unos ingresos de 4570 millones de dólares, un aumento del 29 % con respecto al año anterior.","https://etoro-cdn.etorostatic.com/market-avatars/amat/150x150.png","4322","-7.45","2022-06-16 13:20:10"),
("25","Advanced Micro Devices","$","","AMD","AMD","cedear","Advanced Micro Devices Inc. (AMD) se fundó en 1969 y crea informática de alto rendimiento, gráficos y tecnología de visualización para juegos, plataformas inmersivas y centro de datos. Advanced Micro Devices presta servicio a cientos de millones de consumidores, empresas de la lista Fortune 500 e instalaciones de investigación científica. Los resultados financieros del segundo trimestre de la empresa en el año fiscal 2018 incluyeron un aumento en los ingresos interanuales del 53 % hasta la cifra de 1760 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/amd/150x150.png","39255","-7.99","2022-06-16 13:20:11"),
("26","Amgen","$","","AMGN","AMGN","cedear","Amgen Inc. es una compañía de biotecnología que desarrolla y comercializa medicamentos. La firma establecida en 1980, tiene presencia en cerca de 100 países y cotiza su acción en el NASDAQ con el símbolo bursátil AMGN. Amgen tiene su sede en California, Estados Unidos","https://etoro-cdn.etorostatic.com/market-avatars/amgn/150x150.png","5584","-0.22","2022-06-16 13:20:11"),
("27","America Movil","$","","AMX","AMX","cedear","America Movil S.A.B. de C.V. ofrece servicios de telecomunicaciones en diferentes países de Latinoamérica, EE. UU. y Europa, coordinando operaciones desde su sede en Ciudad de México (México). Se fundó en 2000 y el precio de sus acciones se negocia en la NYSE con el símbolo bursátil AMX. ","https://etoro-cdn.etorostatic.com/market-avatars/amx/150x150.png","4654.5","-1.41","2022-06-16 13:20:11"),
("28","Amazon","$","","AMZN","AMZN","cedear","Amazon.com Inc. es una empresa de servicios en la nube y minorista en Internet con más de 137 millones de cuentas de clientes activos. Entre los productos de la empresa se incluyen compras con 1 clic, Prime, Fulfillment by Amazon, AWS, Kindle Direct Publishing, Kindle, tabletas Fire, Fire TV, Amazon Echo, Alexa, y más. Los resultados financieros de la empresa en el segundo trimestre del año fiscal 2018 incluyeron un aumento en las ventas netas del 39 % hasta la cifra de 52,900 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/amzn/150x150.png","174.25","-2.92","2022-06-16 13:20:12"),
("29","Arcos Dorados Holdings","$","","ARCO","ARCO","cedear","","https://s3-symbol-logo.tradingview.com/arcos-dorados.svg","3350","-4.31","2022-06-16 13:20:12"),
("30","Yamana Gold Inc.","$","","AUY","AUY","cedear","Yamana Gold es una empresa minera dedicada a la exploración y producción de metales preciosos, específicamente oro y plata. Fue fundada en 1980 y tiene su sede principal en Toronto, Canadá. Sin embargo, opera en Argentina, Canadá, Chile y Brasil, entre otros. La firma cotiza en la bolsa de valores de Nueva York bajo el teletipo AUY","https://etoro-cdn.etorostatic.com/market-avatars/6605/150x150.png","1258.5","2.32","2022-06-16 13:20:12"),
("31","Broadcom Inc.","$","","AVGO","AVGO","cedear","Broadcom Inc., un proveedor estadounidense de soluciones de semiconductores, ha experimentado muchos cambios en su larga historia. Broadcom Inc. se fundó en 1961 como una división de semiconductores de Hewlett-Packard. Esta división la compró Agilent Technologies en 1999, y siguió formando parte de la empresa hasta 2005, cuando KKR y Silver Lake Partners compraron la división de chips a Agilent por 2600 millones de dólares. Esta división se convirtió en Avago Technologies, con sede en San José (California).\n\n\n\nAvago compró Broadcom a Broadcom Corporation en 2016, y decidió cambiar el nombre de la empresa a Broadcom Inc., con lo que se deshicieron por completo de la denominación Avago. No obstante, el símbolo en bolsa sigue siendo AVGO. La acción de Broadcom Inc. cotiza en el índice Nasdaq, así como en el Nasdaq-100 y el S&P 500.\n\n\n\nBroadcom Inc. estuvo a punto de verse involucrada en una de las mayores adquisiciones de la historia, pues la empresa realizó una oferta de 130 millones de dólares para comprar el gigante de equipos de semiconductores y telecomunicaciones Qualcomm, pero la junta de esta empresa rechazó la oferta. El Gobierno de Estados Unidos vetó un audaz segundo intento de Broadcom Inc. para fusionarse con Qualcomm.","https://etoro-cdn.etorostatic.com/market-avatars/4236/150x150.png","3063","-5.24","2022-06-16 13:20:13"),
("32","Avery Dennison","$","","AVY","AVY","cedear","Avery Dennison Corporation fabrica y comercializa etiquetas, empaques y materiales sensibles a la presión en diferentes segmentos de consumo tanto en Estados Unidos como internacionalmente. Se fundó en 1935 y tiene su sede en Glendale, California (EE. UU.). Se cotiza en la NYSE con el símbolo bursátil AVY.","https://etoro-cdn.etorostatic.com/market-avatars/avy/150x150.png","12200","-0.58","2022-06-16 13:20:14"),
("33","American Express","$","","AXP","AXP","cedear","American Express CO ofrece productos de tarjetas de pago y crédito, así como servicios relacionados a viajes en todo el mundo. Se fundó en 1850 y tiene su sede principal en Nueva York (EE. UU.). Las acciones de American Express se negocian en la NYSE con el símbolo bursátil AXP","https://etoro-cdn.etorostatic.com/market-avatars/axp/150x150.png","6635","-5.85","2022-06-16 13:20:14"),
("34","Astrazeneca","$","","AZN","AZN","cedear","ASTRAZENECA-ADR es una empresa farmacéutica global que emplea a 64,000 personas y se centra en el descubrimiento científico, desarrollo y comercialización de medicinas con receta en determinadas áreas como oncología; cardiovascular, renal y metabolismo (CVRM); y enfermedades respiratorias. AstraZeneca opera actualmente en más de 100 países y millones de pacientes en todo el mundo consumen sus medicamentos.\n\nEn 2018, la empresa tuvo 23 autorizaciones de nuevas entidades moleculares o destacados proyectos de gestión del ciclo de vida en uno de sus principales mercados, incluyendo 13 autorizaciones oncológicas, 6 autorizaciones de CVRM, y tres autorizaciones respiratorias.\n\n\n\nASTRAZENECA-ADR informa que 157 proyectos se encuentran actualmente en la cartera de la empresa y nueve entidades moleculares se han incluido en su cartera de fase tardía. Además, 102 manuscritos fueron publicados por científicos de la empresa y aparecieron en revistas médicas y científicas de alto impacto analizados por otros colegas.\n\n\n\nEn 2018, la empresa comunicó unas ventas de productos por valor de 21,049 millones de euros, lo que supone un aumento del 4 %, y unos ingresos por sus plataformas de crecimiento de 18,464 millones de euros, que representan un incremento del 13 %. ¿Está interesado en invertir en este instrumento? Sígalo para obtener noticias e información sobre el valor actual de AZN","https://etoro-cdn.etorostatic.com/market-avatars/4239/150x150.png","7374.5","1.9","2022-06-16 13:20:14"),
("35","Boeing","$","","BA","BA","cedear","The Boeing Company es una empresa aeroespacial que fabrica aviones de pasajeros comerciales, sistemas de defensa, espaciales y de seguridad y presta servicios de posventa. Los productos y servicios adaptados incluyen aviones comerciales y militares, satélites, armas, sistemas electrónicos y de defensa, sistemas de despegue, sistemas avanzados de información y comunicación, y logística y formación basada en el rendimiento. Boeing atiende a clientes en más de 150 países. La empresa cuenta con una cartera de pedidos por un valor cercano a los 500,000 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/ba/150x150.png","5396","1.33","2022-06-16 13:20:15"),
("36","Bank Of America","$","","BA-C","BA.C","cedear","Bank of America presta servicios financieros a particulares, empresas e inversores institucionales. En total, el alcance de la banca minorista de Bank of America abarca aproximadamente el 85 % de la población estadounidense, y presta servicio a unos 67 millones de consumidores y pequeñas empresas. En 2017, Bank of America devolvió capital por valor de 15,900 millones de dólares a través de dividendos ordinarios y readquisición de acciones.","https://etoro-cdn.etorostatic.com/market-avatars/bac/150x150.png","3845","0.21","2022-06-16 13:20:15"),
