("39","Banco Bradesco S.A","$","","BBD","BBD","cedear","Banco Bradesco ADR se dedica a los servicios financieros y de seguros, enfocándose en los segmentos de banca y aseguradoras en Brasil. Inició operaciones en 1943 y tiene su sede en Osasco (Brasil). Se cotiza en la NYSE con el símbolo bursátil BBD.","https://etoro-cdn.etorostatic.com/market-avatars/4250/150x150.png","840","-4.65","2022-06-16 13:20:16"),
