("42","Bhp Billiton Ltd","$","","BHP","BHP","cedear","La fusión en 2001 de la compañía australiana Broken Hill Propietary (BHP) y la compañía británica Billiton dieron origen a una de las compañías mineras más grandes del mundo: BHP Group Ltd. La firma se dedica al descubrimiento, adquisición, desarrollo y comercialización de materiales básicos como petróleo, el cobre, el mineral de hierro y carbón. Tiene su sede mundial en Melbourne, Australia, y al 2020 cuenta con más de 72.000 empleados y contratistas ubicados en Australia y América, específicamente en Brasil, Canadá, Chile, Colombia y Perú. \n\n\n\nEn el año fiscal 2020 los ingresos de la compañía minera BHP totalizaron $42,9 mil millones, por debajo de los $44,3 mil millones anotados el año anterior. La utilidad de la operación fue de $14,4 mil millones, un 11% menor que en el año fiscal 2019. BHP lo atribuyó a menores precios y volúmenes y a un mayor agotamiento de desmonte diferido en la mina Escondida en Chile.\n\n\n\nLa acción BHP Group Ltd, que se transa con el símbolo de BHP en la principal bolsa de valores de Australia cayó 8,3% en el primer semestre de 2020. En tanto, el precio de los ADR de BHP Group Ltd que operan en la Bolsa de Nueva York anotan un retroceso de 9,3% en el mismo período. ","https://etoro-cdn.etorostatic.com/market-avatars/4235/150x150.png","7158","-2.33","2022-06-16 13:20:17"),
