("84","Gilead Sciences","$","","GILD","GILD","cedear","La biofarmacéutica Gilead Sciences Inc se dedica al descubrimiento, desarrollo y comercialización de medicamentos en las áreas de necesidades médicas no satisfechas a nivel internacional. Se fundó en 1987 y tiene su sede en Foster City, California (EE.UU.). Las acciones de Giliead Sciences se cotizan en la NASDAQ con el símbolo GILD.","https://etoro-cdn.etorostatic.com/market-avatars/gild/150x150.png","3493","-0.6","2022-06-16 13:20:34"),
("85","Globant","$","","GLNT","GLNT","cedear","","https://etoro-cdn.etorostatic.com/market-avatars/8656/150x150.png","6934.5","-0.05","2022-06-16 13:20:34"),
("86","Corning","$","","GLW","GLW","cedear","Corning Inc es una compañía de tecnología y materiales que manufactura productos avanzados en vidrio, cerámica, y otros materiales. Opera a nivel internacional y cotiza en la NYSE con el símbolo GLW. Coming Inc fue fundada originalmente en 1851 y tiene su sede en Corning, Nueva York.","https://etoro-cdn.etorostatic.com/market-avatars/glw/150x150.png","1895","-3.14","2022-06-16 13:20:34"),
("87","Barrick Gold","$","","GOLD","GOLD","cedear","El oro es uno de los metales preciosos y materias primas más seguidas y se considera un refugio seguro en tiempos de incertidumbre. Aunque los precios del oro pueden experimentar alta volatilidad por sus factores de riesgo intrínsecos, se considera que este metal precioso es estable y una inversión segura a largo plazo.\n\n¿Qué conduce los precios del oro?\n\nUno de los principales motores del oro, como en toda materia prima, es la oferta y la demanda. Si la demanda de oro es superior a la oferta, los precios suben y viceversa.\n\nLa política monetaria, la geopolítica, los desastres naturales y el dólar (EE.UU.) afectan a los precios del oro. El riesgo geopolítico es un factor clave del oro. En tiempos de incertidumbre, los precios tienden a subir.\n\nPor ejemplo, si hay un tema político sensible, referéndum, guerra civil o falta de confianza en un gobernante, el impacto se aprecia por los cambios en el precio del oro. \n\nComo los precios del oro se fijan normalmente en dólares (EE. UU.), un dólar débil hace subir el precio del oro y viceversa.\n\nTodo el que piense en invertir en oro debe tener presentes los factores clave del oro y estar siempre pendiente de la escena política mundial.","https://etoro-cdn.etorostatic.com/market-avatars/gold/70x70.png","4840","3.57","2022-06-16 13:20:35"),
("88","Google","$","","GOOGL","GOOGL","cedear","Alphabet Inc. es una multinacional estadounidense con sede en Mountain View, California, fundada en 2015 tras un proceso de reorganización de Google. La empresa se dedica a la adquisición y operación de diferentes segmentos de negocios. La filial más conocida de Alphabet Inc. es Google, mediante la cual administra los servicios online Android, Chrome, YouTube, Drive, Google Maps, entre otros. Alphabet también gestiona otros segmentos denominados Other Bets, los cuales son negocios como Acess, Calico, Verily y Waymo. \n\n\n\nGoogle empezó a cotizar en la bolsa en agosto de 2004 con un precio de lanzamiento de $85 por acción. En abril de 2014, la empresa dividió la acción en títulos de clase A (con derecho a voto) y clase C (sin derecho a voto). La acción GOOGL hace referencia a las acciones de clase C de Alphabet Inc.\n\n\n\nAlphabet cotiza en la bolsa NASDAQ y la Bolsa de Valores de Fráncfort. La empresa está incluida en los índices NASDAQ Composite, S&P 500 y NASDAQ 100. A agosto de 2020, el precio de la acción de Alphabet cotiza en el rango de los $1.500, mostrando una valorización cercana al 1.600% en comparación con el precio de la OPI.\n\n","https://etoro-cdn.etorostatic.com/market-avatars/6434/150x150.png","8850.5","-2.32","2022-06-16 13:20:35"),
("89","Geopark Ltd","$","","GPRK","GPRK","cedear","","data:image/png;base64,","3550","-3.81","2022-06-16 13:20:36"),
("90","Garmin Ltd","$","","GRMN","GRMN","cedear","Garmin Ltd. se fundó en 1990 y su sede se ubica en Schaffhausen, Suiza. La empresa desarrolla y vende dispositivos portátiles de navegación mediante GPS para los sectores verticales de fitness, actividades al aire libre, vehículos, aviación y náutico. Entre sus productos se incluyen dispositivos para atletismo, ciclismo, navegación personal, control de vuelos, seguimiento de perros, y más. La empresa comercializa estos y otros productos en establecimientos minoristas y también mediante comerciantes externos, fabricantes y distribuidores. ","https://etoro-cdn.etorostatic.com/market-avatars/grmn/150x150.png","7093","0","2022-06-16 13:20:36"),
("91","Goldman Sachs","$","","GS","GS","cedear","The Goldman Sachs Group Inc. se fundó en 1869 y su sede se ubica en Nueva York. Esta empresa de banca de inversión, valores y gestión de inversiones ofrece una amplia gama de servicios financieros a corporaciones, instituciones financieras, gobiernos y particulares. En el año fiscal 2017, Goldman Sachs comunicó unos ingresos netos de 32,100 millones de dólares, lo que representa un incremento del 5 % con respecto al 2016","https://etoro-cdn.etorostatic.com/market-avatars/gs/150x150.png","5270","-1.61","2022-06-16 13:20:36"),
("92","Glaxosmithkline","$","","GSK","GSK","cedear","La farmacéutica GlaxoSmithKline PLC se dedica a la investigación, el desarrollo y la fabricación de medicamentos de vacuna de venta libre, vacunas, productos farmacéuticos y artículos relacionados con el cuidado de la salud. Sus productos se comercializan en Reino Unido, Estados Unidos y en diferentes países. La compañía fue fundada en 1715 y tiene su oficina principal en Londres (Reino Unido), así como oficinas importantes en Estados Unidos y una sede regional en Singapur. \n\n\n\nLas acciones de GlaxoSmithKline PLC se cotizan en la bolsa de Londres con el símbolo GSK. En enero de 2021, GlaxoSmithKline PLC recibió la aprobación de la Administración de Medicamentos y Alimentos, FDA, para su régimen de acción prolongada contra el VIH Cabenuva y anunció su distribución en Estados Unidos para febrero del mismo año. Al cierre del tercer trimestre de 2020, la empresa reportó 40 medicamentos y 18 vacunas en desarrollo. \n\n\n\nLas operaciones de la compañía se enfocan en 4 segmentos: productos farmacéuticos, investigación y desarrollo de productos farmacéuticos, vacunas y productos sanitarios de consumo; abarcando diferentes áreas terapéuticas como tratamiento del VIH, oncología, antivirales, enfermedades del sistema nervioso central, dermatología, entre otros.","https://etoro-cdn.etorostatic.com/market-avatars/8681/150x150.png","2519.5","0.14","2022-06-16 13:20:37"),
("93","Halliburton Co","$","","HAL","HAL","cedear","Halliburton Company ofrece una serie de servicios y productos a empresas petroleras y de gas natural de todo el mundo. La empresa fue fundada en 1919 y tiene su sede en Houston, Texas (EE. UU.). Cotiza en la NYSE con el símbolo bursátil HAL.","https://etoro-cdn.etorostatic.com/market-avatars/hal/150x150.png","4050","-5.81","2022-06-16 13:20:37"),
("94","Home Depot","$","","HD","HD","cedear","The Home Depot, Inc. es un minorista de productos para el hogar que gestiona tiendas The Home Depot en las que venden materiales de construcción y productos para el hogar tanto en Estados Unidos como internacionalmente. La empresa fue fundada en 1978 y tiene su sede en Atlanta, Georgia (EE. UU.). Cotiza en la NYSE con el símbolo bursátil HD","https://etoro-cdn.etorostatic.com/market-avatars/hd/150x150.png","8239","-1.67","2022-06-16 13:20:38"),
("95","Hecla Mining","$","","HL","HL","cedear","","data:image/png;base64,","1100","5.57","2022-06-16 13:20:38"),
("96","Honda Motor","$","","HMC","HMC","cedear","Honda Motor Co., Ltd. desarrolla, fabrica y distribuye motocicletas, automóviles, productos energéticos y otros productos tanto en Japón y Estados Unidos como internacionalmente. La empresa fue fundada en 1946 y tiene su sede en Tokio (Japón). Cotiza en la NYSE con el símbolo bursátil HMC.","https://etoro-cdn.etorostatic.com/market-avatars/hmc/150x150.png","5885.5","-0.9","2022-06-16 13:20:38"),
("97","Harmony Gold","$","","HMY","HMY","cedear","Harmony Gold Mining Company es una empresa de exploración, extracción y procesamiento de oro, depósitos de uranio, plata y cobre, lleva a cabo sus actividades en Sudafrica y Nueva Guinea. Fundada en 1950 con sede en Randfontein, Sudafrica. Cotiza con el símbolo bursátil HMY en la bolsa de Nasdaq, también como HARJ en Francfort y Johannesburgo.","https://etoro-cdn.etorostatic.com/market-avatars/6730/150x150.png","783.5","2.75","2022-06-16 13:20:39"),
("98","Harley Davidson","$","","HOG","HOG","cedear","Harley-Davidson, Inc. fabrica y vende motocicletas custom, cruiser y touring, así como sus repuestos. La empresa opera en todo el mundo, fue fundada en 1903 y tiene su sede en Milwaukee, Wisconsin (EE. UU.). Cotiza en la NYSE con el símbolo bursátil HOG. ","https://etoro-cdn.etorostatic.com/market-avatars/hog/150x150.png","2438","0","2022-06-16 13:20:39"),
("99","Honeywell International","$","","HON","HON","cedear","Honeywell International Inc. es una empresa de tecnología y fabricación diversificada que opera ingeniería y sistemas aeroespaciales a nivel mundial. La empresa fue fundada en 1985 y tiene su sede en Charlotte, Carolina del Norte (EE. UU.). Cotiza en la NYSE con el símbolo bursátil HON.","https://etoro-cdn.etorostatic.com/market-avatars/hon/150x150.png","5417","-1.22","2022-06-16 13:20:39"),
("100","Hewlett-Packard","$","","HPQ","HPQ","cedear","Hewlett Packard ofrece ordenadores personales y otros dispositivos de acceso, productos de imagen e impresión y tecnologías, soluciones y servicios relacionados en Estados Unidos e internacionalmente. La empresa fue fundada en 1939 y tiene su sede en Palo Alto, California (EE. UU.). Cotiza en la NYSE con el símbolo bursátil HPQ.","https://etoro-cdn.etorostatic.com/market-avatars/hpq/150x150.png","7860","-5.2","2022-06-16 13:20:40");
INSERT INTO inversion_instrumentos VALUES
("101","Hsbc Holdings","$","","HSBC","HSBC","cedear","HSBC Holdings plc ofrece productos y servicios bancarios y financieros en todo el mundo. La empresa fue fundada en 1865 y tiene su sede en Londres (Reino Unido). Cotiza en la NYSE con el símbolo bursátil HSBC. ","https://etoro-cdn.etorostatic.com/market-avatars/hbc/150x150.png","3753","-1.91","2022-06-16 13:20:40"),
("102","Hershey","$","","HSY","HSY","cedear","The Hershey Company se fundó en 1894 y su sede se ubica en Hershey, Pensilvania.\n\nLa empresa produce bombones y otros aperitivos bajo una variedad de marcas, que incluyen: Hershey\'s, Kit Kat, Reese\'s, Jolly Rancher, Cadbury, Twizzlers, Whoppers y más. En mayo de 2018, el consejo de administración de The Hershey Company anunció dividendos trimestrales de 0,656 dólares. Se trata del 354º dividendo ordinario consecutivo de la empresa para los inversores de HSY.","https://etoro-cdn.etorostatic.com/market-avatars/hsy/150x150.png","16482.5","-0.14","2022-06-16 13:20:41"),
("103","Howmet Aerospace","$","","HWM","HWM","cedear","Howmet Aerospace es una empresa que proporciona soluciones de ingeniería avanzadas para industrias aeroespacial y de transporte. Son productores de componentes de turbinas de gas industrial y motores aeronáuticos, perfiles aerodinámicos, anillos, discos y piezas forjadas. La compañíacon sede en Pittsburgh, Pennsylvania,cotiza en la bolsa de Nueva York con el símbolo bursátil HWM","https://etoro-cdn.etorostatic.com/market-avatars/6741/150x150.png","7822","0","2022-06-16 13:20:41"),
("104","Ibm","$","","IBM","IBM","cedear","International Business Machines Corporation (IBM) se fundó en 1911 y tiene su sede en Armonk, Nueva York. Esta empresa de tecnología global desarrolla y fabrica soluciones de hardware y software para individuos y empresas de diferentes tamaños, y brinda servicios de hosting y consultoría. IBM opera en una amplia gama de sectores, incluidos el aeroespacial y de defensa, automotriz, banca y finanzas, educación, electrónica, energía y muchas más. Los resultados de la compañía en el segundo trimestre del año fiscal 2018 incluyeron ingresos de 20.000 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/ibm/150x150.png","6571","0.06","2022-06-16 13:20:42"),
("105","Intel","$","","INTC","INTC","cedear","Intel Corporation se fundó en 1968 y su sede se ubica en Santa Clara, California. Esta empresa tecnológica es un fabricante de chips y semiconductores que se asocia con diversos fabricantes, incluyendo Apple, HP, Lenovo, Dell y otros. Los productos de la empresa también incluyen procesadores, chipsets, matrices de puertas programables in situ, soluciones de alimentación, soluciones de memoria y almacenamiento y más. Los resultados financieros de Intel en el segundo trimestre del año fiscal 2018 incluyeron un aumento en los ingresos del 15 % hasta la cifra de 17,000 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/intc/150x150.png","1795","-2.68","2022-06-16 13:20:42"),
("106","International Paper","$","","IP","IP","cedear","International Paper Company es una empresa de papel y embalaje que opera principalmente en Estados Unidos, Oriente Medio y Europa. La empresa fue fundada en 1898 y tiene su sede en Memphis, Tennessee (EE. UU.). Cotiza en la NYSE con el símbolo bursátil IP.","https://etoro-cdn.etorostatic.com/market-avatars/ip/150x150.png","2510","0","2022-06-16 13:20:42"),
("107","Banco Itaú Unibanco S.A","$","","ITUB","ITUB","cedear","Itaú Unibanco se fundó en 1924, aunque Itaú Unibanco Holding S.A. se constituyó en 2008. Este banco multinacional brasileño, con sede en São Paulo, opera 4121 sucursales que ofrecen todos los servicios en Brasil y en el extranjero, y 27,960 cajeros automáticos. El banco emplea a 99,661 personas, 90,323 de ellas en Brasil y 6654 en el extranjero, que prestan servicio a unos 50.4 millones de clientes en todo el mundo.\n\n\n\nEl banco ofrece una amplia gama de servicios financieros, como banca minorista, gestión de activos de terceros, soluciones para los mercados de capitales, corretaje, seguros, pensiones y capitalización, tarjetas de crédito, financiación de vehículos, microcréditos, banca comercial para grandes empresas, gestión de excedentes de capital, y más. Este banco es un importante proveedor de servicios financieros que contribuyen al crecimiento y la expansión de muchas empresas brasileñas.\n\n\n\nItaú Unibanco fue el primer banco brasileño en cotizar en la bolsa de Nueva York cuando salió a bolsa en 1997. En 2018, Interbrand lo designó como la marca brasileña más valiosa, con un valor de 29,800 millones de reales brasileños. Al final del primer trimestre del ejercicio fiscal 2019, el banco comunicó unos ingresos netos recurrentes de 6900 millones de reales. ","https://etoro-cdn.etorostatic.com/market-avatars/4246/150x150.png","1069","-3.74","2022-06-16 13:20:43"),
("108","Jd.Com","$","","JD","JD","cedear","JD.com es una empresa de comercio electrónico y proveedor de servicios de infraestructura minorista en China. Se fundó en 1998 y tiene su sede en Pekín (China). Las acciones de JD.com se cotizan en el Nasdaq con el símbolo bursátil JD.US. Diversifique su cartera con acciones de JD.US","https://etoro-cdn.etorostatic.com/market-avatars/jd.chin/150x150.png","7476.5","-2.64","2022-06-16 13:20:43"),
("109","Johnson & Johnson","$","","JNJ","JNJ","cedear","Johnson & Johnson es una compañía multinacional que desarrolla productos de salud, belleza y cuidado personal. La NYSE cotiza sus acciones con el símbolo JNJ. Johnson & Johnson fue fundada en 1886 y tiene su sede en Nuevo Brunswick, Nueva Jersey (EE. UU.). ","https://etoro-cdn.etorostatic.com/market-avatars/jnj/150x150.png","8227","1.32","2022-06-16 13:20:44"),
("110","Jpmorgan Chase & Co","$","","JPM","JPM","cedear","JPMorgan Chase & Co es una firma global de servicios financieros con activos por valor de 2.6 billones de dólares, y una de las mayores entidades bancarias de Estados Unidos con explotaciones por todo el mundo y presencia comercial en más de 100 mercados. JPMorgan Chase presta servicio a millones de consumidores, pequeñas empresas y clientes corporativos, institucionales y gubernamentales. Ofrece una gama de servicios como banca de inversiones, soluciones financieras para consumidores y pequeñas empresas, banca comercial, procesamiento de transacciones financieras y gestión de patrimonios. Los resultados financieros del segundo trimestre de la empresa en el año fiscal 2018 incluyeron unos ingresos de 27,800 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/jpm/150x150.png","5476","-0.66","2022-06-16 13:20:44"),
("111","Kimberly-Clark","$","","KMB","KMB","cedear","La compañía Kimberly-Clark Corp fue creada en 1882 y tiene su sede principal en Dallas, Texas. Comercializa productos de salud y cuidado personal a nivel internacional a través de marcas como Scott, Huggies y Kleenex. La firma se lista en la NYSE con el símbolo bursátil KMB. ","https://etoro-cdn.etorostatic.com/market-avatars/kmb/150x150.png","4942","2.22","2022-06-16 13:20:45"),
("112","The Coca-Cola Company","$","","KO","KO","cedear","The Coca-Cola Company es un minorista de bebidas que ofrece más de 500 marcas de bebidas con y sin gas, entre ellas, Coca-Cola, Coca-Cola Zero Sugar, Sprite, Bacardi, té verde Ayataka, aguas Dasani, zumos y néctares Del Valle, Fanta, café Georgia, tés y cafés Gold Peak, Honest Tea y muchas otras. La empresa vende 1900 millones de bebidas al día en más de 200 países. Los resultados del segundo trimestre de la empresa en el año fiscal 2018 incluyeron unos ingresos netos de 8900 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/ko/150x150.png","2873","0.81","2022-06-16 13:20:45"),
("113","Eli Lilly","$","","LLY","LLY","cedear","Eli Lilly & Co descubre, desarrolla, fabrica y comercializa productos farmacéuticos para humanos en todo el mundo. La empresa fue fundada en 1876 y tiene su sede en Indianápolis, Indiana (EE. UU.). Cotiza en la NYSE con el símbolo bursátil LLY","https://etoro-cdn.etorostatic.com/market-avatars/lly/150x150.png","8721","-0.39","2022-06-16 13:20:46"),
("114","Lockheed Martin","$","","LMT","LMT","cedear","Lockheed Martin Corporation tiene su sede en Bethesda, Maryland, y se trata de una empresa global aeroespacial y de seguridad que se dedica principalmente a la investigación, diseño, desarrollo y fabricación de sistemas, producos y servicios tecnológicos avanzados. Lockheed Martin cuenta con más de 400 centros en todo el mundo. En 2018, la empresa ganó tres premios Edison por innovaciones revolucionarias en autonomía, tecnología por satélites y energía dirigida. En el segundo trimestre del año fiscal 2018, la empresa comunicó unas ventas netas de 13,400 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/lmt/150x150.png","4913","-0.86","2022-06-16 13:20:46"),
("115","Las Vegas Sands","$","","LVS","LVS","cedear","La firma Las Vegas Sands Corp administra propiedades hoteleras integradas en Estados Unidos y Asia. Sus orígenes se remontan a 1989 con la compra del Hotel Sands en Las Vegas y sus acciones se hallan en la NYSE con el símbolo bursátil LVS. La compañía ubica su sede en Nevada, Estados Unidos","https://etoro-cdn.etorostatic.com/market-avatars/lvs/150x150.png","3576.5","0","2022-06-16 13:20:47"),
("116","Lloyds Banking Group","$","","LYG","LYG","cedear","","https://etoro-cdn.etorostatic.com/market-avatars/6772/150x150.png","242","-3.59","2022-06-16 13:20:47"),
("117","Mastercard Inc","$","","MA","MA","cedear","Mastercard Incorporated se fundó en 1966 y su sede se ubica en Purchase, Nueva York. Esta empresa tecnológica de pagos global ofrece soluciones financieras a clientes, empresas, vendedores, emisores y gobiernos, en más de 210 países y territorios en todo el mundo. Los resultados financieros del segundo trimestre de la empresa en el año fiscal 2018 incluyeron unos beneficios netos de 1600 millones de dólares y unos ingresos netos de 3700 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/ma/150x150.png","2246.5","-4.04","2022-06-16 13:20:48"),
("118","Mcdonald\'s","$","","MCD","MCD","cedear","McDonald\'s Corporation se fundó en 1940 y su sede se ubica en Chicago, Illinois. Este minorista internacional de servicios alimentarios explota más de 36,000 restaurantes en más de 100 países en todo el mundo y atiende a más de 69 millones de clientes al día. Los productos de la empresa incluyen hamburguesas, patatas fritas, productos a base de pollo, productos de desayuno, postres y más. Los resultados de McDonald\'s en el segundo trimestre de 2018 incluyeron un aumento de las ventas globales comparables del 4 %","https://etoro-cdn.etorostatic.com/market-avatars/mcd/150x150.png","7119","-0.28","2022-06-16 13:20:48"),
("119","Medtronic","$","","MDT","MDT","cedear","Medtronic PLC es una empresa de soluciones de salud que brinda servicios en los campos de la cardiología, la diabetes, la neurociencia y las terapias de recuperación. La firma tiene presencia en más de 140 países y se halla en la NYSE con el símbolo bursátil MDT. Medtronic PLC fue fundada originalmente en 1949 y tiene su sede en Dublín, Irlanda.","https://etoro-cdn.etorostatic.com/market-avatars/mdt/150x150.png","5282.5","-1.64","2022-06-16 13:20:48"),
("120","Mercadolibre","$","","MELI","MELI","cedear","MercadoLibre, Inc. es una empresa de comercio electrónico que se constituyó el 15 de octubre de 1999, y su sede se ubica en Buenos Aires (Argentina). La empresa funciona como un mercado en línea que permite el comercio electrónico de vehículos a motor, navíos, aviones, servicios, inmuebles y más, dentro y fuera de América Latina. Las soluciones que ofrece MercadoLibre, Inc. incluyen un servicio de anuncios clasificados, soluciones de pagos, programas de publicidad y servicios de envío, entre otros. La empresa se centra en áreas como Brasil, Argentina, México, y otros países como Chile, Colombia, Costa Rica, Ecuador, Panamá, Perú, Portugal, Guatemala, Bolivia, Paraguay, Uruguay y Estados Unidos.","https://etoro-cdn.etorostatic.com/market-avatars/meli/150x150.png","2495","-7.06","2022-06-16 13:20:49"),
("121","Marsh & Mclennan","$","","MMC","MMC","cedear","La firma Marsh & McLennan Cos Inc. proporciona servicios de consultoría, aseguramiento y manejo de riesgo. Realiza sus operaciones en más de 100 países y negocia en la NYSE con el símbolo bursátil MMC. La firma fue constituida oficialmente en 1923 y se ubica en Nueva York, Estados Unidos","https://etoro-cdn.etorostatic.com/market-avatars/mmc/150x150.png","8777.5","0","2022-06-16 13:20:49"),
("122","3M","$","","MMM","MMM","cedear","3M desarrolla y fabrica productos a nivel mundial, enfocándose en los segmentos de seguridad industrial, transporte y electrónicos, y cuidado de la salud, para su comercialización a nivel mundial. Se fundó en 1902 y tiene su sede en St. Paul, Minnesota (EE. UU.). Las acciones de 3M se negocian en la NYSE con el símbolo bursátil MMM.","https://etoro-cdn.etorostatic.com/market-avatars/mmm/150x150.png","6314","-2.06","2022-06-16 13:20:49"),
