("138","Orange","$","","ORAN","ORAN","cedear","Orange SA brinda servicios de telefonía fija y móvil en diferentes países de Europa, África y Oriente Medio, ofreciendo servicios móviles en los que incluye llamadas, mensajería de texto y transmisión de datos. La empresa tiene su oficina principal en París (Francia) y fue fundada en 1990, pero no fue sino hasta 2001 que cambió su nombre a Orange S.A.\n\n\n\nLas acciones de Orange S.A. se negocian en NYSE con el código ORAN. En su informe de resultados del tercer trimestre de 2020, la compañía reportó un incremento en ingresos a pesar de la crisis sanitaria. En enero de 2021, contaba con una capitalización de mercado de 25.492 mil millones de euros.\n\n\n\nLa empresa también vende equipos de telefonía móvil, equipos de banda ancha y diferentes accesorios relacionados. Además, cuenta con servicios de itinerancia local e internacional, así como operadores de redes móviles virtuales, redes compartidas y servicios financieros móviles. Comercializa sus productos bajo la marca Orange. En enero de 2021, Orange anunció la creación de una empresa conjunta con Sanofi, Capgemini y Generali para formar un ecosistema digital dedicado a la e-salud y soluciones sanitarias.","https://etoro-cdn.etorostatic.com/market-avatars/8673/150x150.png","2756","2.3","2022-06-16 13:20:56"),
