("148","Posco","$","","PKS","PKS","cedear","Fundada en 1968, la firma POSCO se dedica a la manufactura y la comercialización de productos de acero. La compañía desarrolla sus operaciones de forma internacional en los segmentos del acero, la construcción, el comercio y otras actividades. POSCO fue constituida y tiene sus oficinas principales en la ciudad de Pohang (Corea del Sur) y ha sido reconocida durante diez años consecutivos como una de las siderúrgicas más competitivas a nivel mundial por parte de World Steel Dynamics.\n\n\n\nEn febrero de 2021, el valor financiero de la compañía se estimaba en 21.000 millones de dólares y sus acciones se cotizaban en la NYSE con el símbolo bursátil PKX. Entre 2015 y 2020, las acciones de POSCO arrojaron dividendos anuales a sus inversionistas, los cuales provienen en su mayoría del sector extranjero, que tiene una participación del 51 % del total de acciones.\n\n\n\nPOSCO realiza actividades en más de 50 países y produce una media de 41 millones de toneladas de acero bruto al año. Sus productos se utilizan en diferentes sectores, como la construcción, la industria automotriz y las plantas de energía eléctrica, entre otros. ","https://etoro-cdn.etorostatic.com/market-avatars/8652/150x150.png","4031","3.99","2022-06-16 13:21:01"),
