("153","Rio Tinto","$","","RIO","RIO","cedear","Rio Tinto Ltd. (RIO) nació en 1873, cuando un grupo inversor compró las minas de Río Tinto, en España. Desde entonces, la compañía ha crecido hasta convertirse en la primera productora de cobre del mundo y trabajar en 36 países. Esta compañía minera se encarga tanto de encontrar los minerales como de extraerlos y procesarlos. Aparte del cobre, sus actividades también se dedican al hierro, el aluminio, los diamantes, el oro y los materiales industriales. Para la industria, producen boratos, dióxido de titanio y sal. Los principales países donde trabaja Rio Tinto Ltd. son Australia, Canadá, Mongolia, Estados Unidos, Chile e Indonesia, mientras que sus oficinas centrales están en Londres.\n\n\n\nLas acciones de RIO cotizan en la bolsa ASX de Australia, pero también en la NYSE. El gráfico muestra que, en agosto de 2020, la compañía se había recuperado por completo de la caída que provocó el coronavirus en la primavera del mismo año.\n\n\n\nEn 2019, la compañía obtuvo $14,90M de beneficio neto gracias a las actividades de explotación. Al mismo tiempo, están trabajando en reducir las emisiones de gases de efecto invernadero de forma considerable.","https://etoro-cdn.etorostatic.com/market-avatars/4240/150x150.png","4100","-1.32","2022-06-16 13:21:03"),
