("156","Sap","$","","SAP","SAP","cedear","SAP SE es una empresa de software alemana dedicada a los segmentos de aplicaciones, tecnología y servicios; redes de negocios y experiencia del cliente; ofreciendo diferentes programas para análisis y gestión de negocios a nivel mundial. La compañía fue fundada en 1972 y tiene su oficina principal en la ciudad de Walldorf (Alemania).\n\n\n\nLas acciones de SAP SE se cotizan en Xetra, y su precio se negocia con el símbolo bursátil SAP. Para enero de 2021, la empresa cuenta con más de 440.000 millones de clientes alrededor del mundo, expandiendo su alcance con la adquisición de marcas y compañías, y ofreciendo un servicio integral a empresas de diferentes sectores económicos. A finales del mismo mes, SAP SE busca expandir su oferta de servicios de nube con la compra de la compañía Signavio.\n\n\n\nEntre los productos ofrecidos por la empresa, destacan SAP HANA, un software para el análisis de información en tiempo real; SAP Leonardo, un sistema que combina servicios de pensamiento de diseño con tecnologías inteligentes para optimizar procesos empresariales, y SAP Analytics Cloud para la optimización de inteligencia empresarial, planificación y procesos.","https://etoro-cdn.etorostatic.com/market-avatars/8678/150x150.png","3684","-0.49","2022-06-16 13:21:04"),
