("168","Spotify Technology S.A","$","","SPOT","SPOT","cedear","Fundada en 2006 y lanzada en 2008, este empresa sueca es la creadora de uno de los servicios de música en streaming más populares del mundo, y cuenta con millones de usuarios de pago en todo el mundo. Spotify, que sale a bolsa en 2018, es una de las empresas tecnológicas europeas más conocidas del mundo. La gráfica de Spotify puede verse afectada por diversas condiciones del mercado, como la competencia de empresas como Apple (Apple Music), Google (Google Play Music) y Amazon (Amazon Prime Music), que rivalizan con sus servicios de música en streaming.","https://etoro-cdn.etorostatic.com/market-avatars/1156/150x150.png","852","-5.33","2022-06-16 13:21:09"),
("169","Square Inc","$","","SQ","SQ","cedear","Square Inc. se fundó en 2009 y su sede se ubica en San Francisco, con oficinas en Estados Unidos, Canadá, Japón, Australia, Irlanda y Reino Unido. Se trata de una empresa de pagos en línea que ofrece soluciones, análisis y herramientas de elaboración de informes a puntos de venta y más. Sus productos incluyen Square Stand, Square Register, Square Magstripe Reader, Square Capital, Cash App y más. Los resultados financieros del segundo trimestre de la empresa en el año fiscal 2018 incluyeron un aumento en los ingresos netos totales del 48 % hasta la cifra de 815 millones de dólares. ","https://etoro-cdn.etorostatic.com/market-avatars/sq/150x150.png","695","-7.46","2022-06-16 13:21:10"),
("170","Suzano","$","","SUZ","SUZ","cedear","","https://etoro-cdn.etorostatic.com/market-avatars/6013/150x150.png","2416.5","0","2022-06-16 13:21:10"),
("171","At&T","$","","T","T","cedear","AT&T Inc es una empresa proveedora de servicios de telecomunicación y tecnología a nivel mundial. Inició operaciones en 1983 y tiene su sede en Dallas, Texas (EE. UU.) Las acciones de AT&T se cotizan en la NYSE con el símbolo bursátil T.","https://etoro-cdn.etorostatic.com/market-avatars/t/150x150.png","1520","-2.19","2022-06-16 13:21:10"),
("172","Tenaris","$","","TEN","TEN","cedear","Tenaris es el fabricante y comercializador líder de productos tubulares y servicios relacionados para la industria de la energía y otras aplicaciones industriales. La firma tiene presencia en más de 30 países y sus acciones se cotizan en la Bolsa Italiana con el símbolo bursátil TEN.MI. Tenaris tiene su sede en la Ciudad de Luxemburgo (Luxemburgo) y fue fundada en 2001. ","https://etoro-cdn.etorostatic.com/market-avatars/ten.mi/150x150.png","6660","-3.88","2022-06-16 13:21:11"),
("173","Target Corporation","$","","TGT","TGT","cedear","Target Corporation dirige una cadena de tiendas minoristas de productos de consumo en Estados Unidos. A inicios de 2021 cuenta con casi 2000 tiendas en las que vende alimentos y diferentes tipos de productos. Se fundó en 1902 y tiene su sede en Minneapolis, Minnesota (EE.UU.). Sus acciones se negocian en la NYSE con el símbolo bursátil TGT. ","https://etoro-cdn.etorostatic.com/market-avatars/tgt/150x150.png","8667","-2.08","2022-06-16 13:21:11"),
("174","Tim Participações S.A","$","","TIMB","TIMB","cedear","","data:image/png;base64,","3150","0.64","2022-06-16 13:21:12"),
("175","Toyota Motors","$","","TM","TM","cedear","Toyota Motor Corporation diseña, fabrica y comercializa vehículos y piezas de repuesto a nivel mundial. Inició operaciones en 1937 en Toyota, Japón, donde tiene su oficina principal. Las acciones de Toyota se negocian en la NYSE con el símbolo bursátil TM","https://etoro-cdn.etorostatic.com/market-avatars/tm/150x150.png","7475.5","-0.29","2022-06-16 13:11:12"),
("176","Thermo Fisher Scientific Inc","$","","TMO","TMO","cedear","Thermo Fisher Scientific Inc ofrece soluciones científicas y suministra instrumentos analíticos, equipos, reactivos y consumibles relacionados internacionalmente. Se fundó en 1956 y tiene su sede en Waltham, Massachusetts (EE.UU.). Se cotiza en la NYSE con el símbolo bursátil TMO","https://etoro-cdn.etorostatic.com/market-avatars/tmo/150x150.png","5500","0","2022-06-16 13:11:12"),
("177","Tripadvisor Inc","$","","TRIP","TRIP","cedear","TripAdvisor Inc. es un sitio web global de viajes con unos 661 millones de reseñas que abarcan aproximadamente 7.7 millones de alojamientos, líneas aéreas, experiencias y restaurantes. TripAdvisor también compara precios de más de 200 sitios web de reserva de hoteles. Los sitios web con la marca TripAdvisor están disponibles en 49 mercados y prestan servicio a un promedio mensual de 456 millones de visitantes únicos. El informe de resultados del segundo trimestre del año fiscal 2018 de la empresa incluyó unos ingresos totales de 433 millones de dólares","https://etoro-cdn.etorostatic.com/market-avatars/trip/150x150.png","2236.5","-7.89","2022-06-16 13:11:12"),
("178","Tesla","$","","TSLA","TSLA","cedear","Tesla Motors Inc. (TSLA) es una de las empresas más innovadoras del mundo, especializada en coches eléctricos y equipos de carga de baterías. TSLA ha supuesto un reto para la establecida industria del automóvil al ofrecer vehículos que no consumen gasolina. El CEO de TSLA, Elon Musk, pretende lanzar un modelo asequible para que el usuario medio ayude con el cambio climático.\n\nAl precio de la acción de TSLA le afectan los ingresos de la empresa, que vienen de cambios en leyes y de la política medioambiental.\n\n¿Qué dirige el precio de la acción de TSLA?\n\nComo otras empresas del sector, los ingresos, resultados y precio de la acción dependen de la demanda de vehículos. \n\nOtro factor en el precio de la acción de TSLA es el petróleo y la regulación de la industria petrolera. Si los precios del petróleo están bajos, los consumidores no comprarán coches de TSLA porque costará menos conducir un vehículo de gasolina. \n\nAdemás, si hay menos regulación en la industria petrolera y más países se alejan del cambio climático, el precio de la acción de TSLA bajaría. \n\nComo TSLA ha adquirido SolarCity Corp., que produce sistemas de energía solar, si terminan los subsidios para paneles solares, no habrá incentivo para que los consumidores los instalen en casa. Las empresas tampoco instalarían paneles solares si no hay subsidios, lo que dañaría los resultados e ingresos de TSLA. TSLA afronta riesgos empresariales y geopolíticos.\n\nComo otras empresas del sector, TSLA afronta un riesgo macroeconómico. Si la economía global se debilita, los consumidores serán menos proclives a comprar los coches de gama alta de TSLA. TSLA afronta un riesgo de mercado: si el mercado se liquida, TSLA rendiría menos de lo esperado por su alto coeficiente beta","https://etoro-cdn.etorostatic.com/market-avatars/tsla/150x150.png","10149.5","-8.92","2022-06-16 13:11:13"),
("179","Taiwan Semiconductor Manufacturing","$","","TSM","TSM","cedear","","https://etoro-cdn.etorostatic.com/market-avatars/4481/150x150.png","61105","-5.13","2022-06-16 13:11:13"),
("180","Total","$","","TTE","TTE","cedear","","https://etoro-cdn.etorostatic.com/market-avatars/8684/150x150.png","4620","0","2022-06-16 13:11:13"),
("181","Twitter","$","","TWTR","TWTR","cedear","Twitter se fundó en 2006 y su sede se ubica en San Francisco, California. Esta plataforma global de redes sociales está disponible en más de 40 idiomas y puede accederse a ella a través de twitter.com y de dispositivos móviles. Permite a los usuarios consumir y publicar contenido. Twitter también opera Periscope, una aplicación de transmisión de vídeo a través de dispositivos móviles. Los resultados financieros de la empresa en el primer trimestre del año fiscal 2018 incluyeron unos ingresos netos (fuera de los principios de contabilidad generalmente aceptados) de 123 millones de dólares","https://etoro-cdn.etorostatic.com/market-avatars/twtr/150x150.png","4494","-0.56","2022-06-16 13:11:14"),
("182","Texas Instruments","$","","TXN","TXN","cedear","Texas Instruments Inc se dedica al diseño, la fabricación y la venta de semiconductores a diseñadores y fabricantes de productos electrónicos a nivel mundial. Se fundó en 1930 y tiene su sede en Dallas, Texas (EE. UU.). Las acciones de Texas Instruments se negocian en el Nasdaq con el símbolo bursátil TXN","https://etoro-cdn.etorostatic.com/market-avatars/txn/150x150.png","7292.5","-2.22","2022-06-16 13:11:15"),
("183","Ternium","$","","TXR","TXR","cedear","Ternium SA fabrica y comercializa productos de acero para empresas del sector de construcción, automotriz, transporte y diferentes industrias en Estados Unidos y América Latina. Se fundó en 1961 y tiene su sede en Luxemburgo, Alemania. Las acciones de Ternium se negocian en la NYSE con el símbolo bursátil TX","https://etoro-cdn.etorostatic.com/market-avatars/tx/150x150.png","4460","-4.82","2022-06-16 13:11:15"),
