("185","Unilever","$","","UL","UL","cedear","Unilever es una firma dedicada al comercio de productos de consumo diario con presencia en más de 180 países. Su acción se lista en la LSE con el símbolo ULVR.L. La empresa fue constituida en 1929 y tiene su sede en Londres, Reino Unido.","https://etoro-cdn.etorostatic.com/market-avatars/ulvr.l/150x150.png","3519.5","0.03","2022-06-16 13:11:16"),
("186","Unitedhealth Group Inc","$","","UNH","UNH","cedear","UnitedHealth Group, Inc. ofrece servicios de cobertura sanitaria, software y consultoría de datos a empresas del sector médico en Estados Unidos. Se fundó en 1977 y tiene su sede en Minnetonka, Minnesota (EE.UU.). Las acciones de UnitedHealth se cotizan en la NYSE con el símbolo bursátil UNH","https://etoro-cdn.etorostatic.com/market-avatars/unh/150x150.png","3322","-0.73","2022-06-16 13:11:16"),
("187","Union Pacific Corp","$","","UNP","UNP","cedear","Union Pacific Corporation ofrece servicios de transporte ferroviario y transporte de mercancías en Estados Unidos. Inició operaciones en 1862 y tiene su sede principal en Omaha, Nebraska (EE.UU.). El precio de las acciones de Union Pacific se negocia en la NYSE con el símbolo bursátil UNP","https://etoro-cdn.etorostatic.com/market-avatars/unp/150x150.png","2519.5","0.3","2022-06-16 13:11:17"),
("188","Visa","$","","V","V","cedear","Visa Inc. se fundó en 1958 y es una empresa tecnológica de pagos globales que ofrece soluciones digitales de moneda a clientes, empresas, bancos y gobiernos en más de 200 países y territorios en todo el mundo, con aproximadamente 3300 millones de tarjetas Visa en uso a 31 de diciembre de 2017. En total, se procesan 173,100 millones de transacciones anuales a través de VisaNet","https://etoro-cdn.etorostatic.com/market-avatars/v/150x150.png","7606","-2.56","2022-06-16 13:11:17"),
("189","Vale","$","","VALE","VALE","cedear","Vale SA se dedica a la producción y la venta de hierro y granulados de hierro para su uso como materia prima tanto en Brasil como internacionalmente. Inició sus operaciones en 1942 y tiene su oficina principal en Rio de Janeiro (Brasil). El precio de las acciones de Vale se cotiza en la NYSE con el símbolo bursátil VALE.","https://etoro-cdn.etorostatic.com/market-avatars/vale/150x150.png","1859","-4.18","2022-06-16 13:11:17"),
("190","Vista Oil & Gas","$","","VIST","VIST","cedear","","data:image/png;base64,","9080","-5.9","2022-06-16 13:11:18"),
("191","Telefonica Brasil","$","","VIV","VIV","cedear","","https://etoro-cdn.etorostatic.com/market-avatars/8723/150x150.png","2212","0","2022-06-16 13:11:18"),
("192","Vodafone Group","$","","VOD","VOD","cedear","Fundada en 1982 como Racal Telecom, Vodafone PLC (VOD) es una de las mayores empresas de telecomunicaciones del mundo. Su sede se encuentra en Berkshire (Reino Unido) y ha estado operando durante más de 37 años. Vodafone ofrece servicios de telecomunicación, incluidos televisión, internet, telefonía y servicios móviles, y lidera el mercado solo detrás de China Mobile. \n\n\n\nLa cartera de clientes de Vodafone PLC era de casi 440 millones de personas en 2017. La empresa ha sido incluida en la Bolsa de Valores de Londres y, debido a su precio de cotización, está considerada como la tercera empresa bursátil más cotizada. \n\n\n\nComo activo, puede acceder a las acciones de VOD mediante los mercados de Londres e, indirectamente, invertir por medio del índice NASDAQ en la Bolsa de Nueva York. Como activo tecnológico, el precio de VOD se ve afectado por las nuevas tendencias y el poder de consumo, por lo que podría estar muy bien correlacionado con el gráfico de la libra esterlina. \n\n\n\nLas acciones de VOD tienen una capitalización de mercado de $42.083B para el segundo trimestre de 2020 y se consideran una de las empresas más cotizadas en la Bolsa de Valores de Londres. Con su pico histórico de $66 durante el año 2000 y un comportamiento bastante estable, el precio de las acciones de VOD representa un buen activo tecnológico para su cartera","https://etoro-cdn.etorostatic.com/market-avatars/vod/150x150.png","3765","1.98","2022-06-16 13:11:19"),
("193","Verisign","$","","VRSN","VRSN","cedear","VeriSign Inc. se fundó en 1995 y su sede se ubica en Reston, Virginia. Se trata de una empresa de seguridad en Internet y de servicios de registro de nombres de dominios a nivel global que gestiona y protege la infraestructura DNS de más de 146,4 millones de nombres de dominios .com y .net y procesa más de 132 mil millones de consultas a diario. La empresa opera a través de sus segmentos de Servicios de registro y Servicios de seguridad y también presta servicios de garantía de infraestructuras.","https://etoro-cdn.etorostatic.com/market-avatars/vrsn/150x150.png","6439","0","2022-06-16 13:11:19"),
("194","Verizon Communications","$","","VZ","VZ","cedear","Verizon Communications, Inc. es una empresa de telecomunicaciones que ofrece productos y servicios de comunicación, información y entretenimiento a clientes en todo el mundo. Se constituyó en 1983 y tiene su sede en Nueva York (EE. UU.). Las acciones de Verizon Communications se cotizan en la NYSE con el símbolo bursátil VZ","https://etoro-cdn.etorostatic.com/market-avatars/vz/150x150.png","5927","0.8","2022-06-16 13:11:20"),
("195","Walgreens Boots Alliance Inc","$","","WBA","WBA","cedear","La compañía Walgreens Boots Alliance Inc funciona como una empresa minorista de salud y belleza dirigida por farmacias, ofreciendo productos en más de 25 países. Tiene su sede en Deerfield, Illinois (EE. UU.) y se fundó en 1901. Sus acciones se cotizan en el Nasdaq con el símbolo bursátil WBA","https://etoro-cdn.etorostatic.com/market-avatars/wba/150x150.png","3225","-0.78","2022-06-16 13:11:20"),
("196","Wells Fargo","$","","WFC","WFC","cedear","Wells Fargo & Company es una empresa de servicios financieros en Estados Unidos. Ofrece productos y servicios bancarios, instrumentos de inversión, hipotecas y de finanzas de consumo y comerciales. Se fundó en 1852 y tiene su sede en San Francisco, California (EE. UU.). Las acciones de WFC se cotizan en la NYSE con el símbolo bursátil WFC.","https://etoro-cdn.etorostatic.com/market-avatars/wfc/150x150.png","1815","-0.71","2022-06-16 13:11:21"),
("197","Walmart","$","","WMT","WMT","cedear","Walmart Inc. se fundó en 1962 y se trata de uno de los mayores minoristas del mundo, con más de 11,700 establecimientos bajo 65 insignias en 28 países y un sitio Web de comercio electrónico que presta servicio a unos 270 millones de clientes. Esta empresa opera en 50 estados y Puerto Rico, y cuenta con más de 150 centros de distribución, una flota de 6100 tractores y 61,000 remolques. En el año fiscal 2018, Walmart obtuvo unos ingresos de 500,300 millones de dólares. ","https://etoro-cdn.etorostatic.com/market-avatars/wmt/150x150.png","4873","2.45","2022-06-16 13:11:21"),
("198","United States Steel","$","","X","X","cedear","US Steel ofrece productos de chapa al sector de la construcción. Los productos de la empresa incluyen techos de acero y componentes de enchapado, placas de armazón y conectores, entarimados, sistemas de construcción de metal, encofrados de uso comercial y residencial, soluciones para puertas de uso comercial y residencial, productos para puentes y carreteras, alcantarillas, equipos de calefacción central y aire acondicionado, calentadores de agua, sistemas de estanterías para tiendas y mobiliario de acero. Los resultados de US Steel en el segundo trimestre del año fiscal 2018 incluyeron unos ingresos netos de 214 millones de dólares.","https://etoro-cdn.etorostatic.com/market-avatars/x/150x150.png","1560","-4.76","2022-06-16 13:11:22"),
("199","Exxon Mobil","$","","XOM","XOM","cedear","Exxon-Mobil explora y produce petróleo crudo y gas natural con propósitos energéticos tanto en Estados Unidos como internacionalmente. La empresa fue fundada en 1870 y tiene su sede en Irving, Texas (EE. UU.). Cotiza en la NYSE con el símbolo bursátil XOM. ","https://etoro-cdn.etorostatic.com/market-avatars/xom/150x150.png","4400.5","-2.78","2022-06-16 13:11:22"),
("200","Xerox","$","","XROX","XROX","cedear","Xerox Holdings Corporation comercializa equipos de impresión, además de soluciones empresariales inteligentes, como sistemas de gestión documental y de automatización de procesos. Xerox, fundada en 1906 y con sede en Norwalk, Connecticut (EE. UU.), presta servicios en todo el mundo. La compañía se cotiza en el NYSE con el símbolo bursátil XRX.","https://etoro-cdn.etorostatic.com/market-avatars/xrx/150x150.png","3840","0","2022-06-16 13:11:22");
INSERT INTO inversion_instrumentos VALUES
("201","Yelp Inc","$","","YELP","YELP","cedear","Yelp Inc. se constituyó el 3 de septiembre de 2004, y su sede se ubica en San Francisco, California. La empresa ofrece una plataforma para que los usuarios descubran empresas locales y comuniquen su experiencia de cliente públicamente. A través de su plataforma en línea Yelp, los usuarios pueden comprar productos, hacer reservas, buscar y compartir recomendaciones y más. Las organizaciones incluidas en la plataforma Yelp operan en diversos campos, como alimentos, belleza, fitness, eventos, entretenimiento, viajes y más. La empresa ofrece sus productos a través de sus propios representantes de ventas, e indirectamente mediante socios y en Internet.","https://etoro-cdn.etorostatic.com/market-avatars/yelp/150x150.png","3111","0","2022-06-16 13:11:23"),
("202","Zoom Video Communications Inc","$","","ZM","ZM","cedear","Zoom se fundó en 2011 y tiene su sede en San José, California. La empresa ofrece soluciones de comunicaciones unificadas y centradas en la tecnología de vídeo. Además, opera una plataforma de nube para conferencias de vídeo y audio, reuniones, chat y webinars en dispositivos móviles, ordenadores de mesa, teléfonos y sistemas de habitaciones. Los productos de la empresa se utilizan en todo el mundo en juntas, conferencias, reuniones y salas de formación, así como en oficinas ejecutivas y aulas. Además, son escalables y se pueden integrar sin dificultades en aplicaciones y espacios físicos. El Programa de socios tecnológicos crea un amplio ecosistema de productos que la empresa considera adecuados para funcionar con Zoom, lo que permite a los clientes disfrutar de más opciones y ofrece nuevas maneras de exhibir los productos de los socios. En 2019, Zoom entró en la lista de Inc de las empresas privadas de crecimiento más rápido en Estados Unidos. Ese mismo año, la empresa fue nombrada líder en el informe del Cuadrante Mágico 2019 de Gartner para soluciones de reuniones. Los resultados financieros de la empresa en el tercer trimestre del ejercicio fiscal 2019 incluyeron unos ingresos totales de 166,6 millones de dólares estadounidenses, lo que supone un aumento interanual del 85%","https://etoro-cdn.etorostatic.com/market-avatars/5958/150x150.png","546","-3.87","2022-06-16 13:11:23"),
